import React, { Component } from "react";
import axios from "axios";

export default class getIP extends Component {
  constructor() {
    super();
    this.state = {
      data: []
    };
  }

  getData = () => {
    axios
      .get("http://www.telize.com/geoip?callback=getgeoip")
      .then(data =>
        this.setState({
          data: data
        })
      )
      .catch(error => console.log(error));
  };

  render() {
    return <div>{}</div>;
  }
}
